#######################################################
#  #6.1 - Powershell GUI - Jornada pela interface gráfica
#
#  Objetivos:
#     - Apresentar 3 formas de capturar eventos (event handler)
#     - Como exemplo: captura do clique no botão 'SAIR'
#
########################################################

[void][System.Reflection.Assembly]::LoadWithPartialName("System.Windows.Forms")
[void][System.Reflection.Assembly]::LoadWithPartialName("System.Drawing")
[System.Windows.Forms.Application]::EnableVisualStyles() 



Function _Main {
    $Form6 = New-Object System.Windows.Forms.Form 
    $Form6.ClientSize = New-Object System.Drawing.Size(512,288) 
    $Form6.FormBorderStyle = [System.Windows.Forms.FormBorderStyle]::Fixed3D
    $Form6.Text = ".::. #6 Powershell GUI - Jornada pela interface gráfica .::."
    $Form6.MaximizeBox = $false      #     - Desabilitar 'Maximizar' a Janela
    $Form6.StartPosition = "CenterScreen"

    #######################
    ### Cria Imagem de Fundo a partir de um arquivo .JPG
    #$Form5.BackgroundImage = [System.Drawing.Image]::FromFile($PSScriptRoot + "\Img\Fundo.jpg")

    $base64BGImg = ""
    $BGimageBytes = [Convert]::FromBase64String($base64BGImg)
    $BGims = New-Object IO.MemoryStream($BGimageBytes, 0, $BGimageBytes.Length)
    $Form6.BackgroundImage = [System.Drawing.Image]::FromStream($BGims)

    $Form6.BackgroundImageLayout = "Stretch" ## ajusta-se ao tamanho do Form
        # None, Tile, Center, Stretch, Zoom

    #########################
    ### ÍCONE
    ### Cria ícone carregando de um arquivo .ICO
    #$Form5.Icon = New-Object system.drawing.icon ($PSScriptRoot + "\Img\favicon.ico")

    ########
    ### Cria ícone usando string Base64 obtida de um arquivo .PNG, ou .ICO
    ### Pode ser utilizado https://www.base64-image.de/ para obter a string Base64
    ### 
    ### Um pouco mais complexo, mas tem a vantagem da imagem ficar integrada no código
    ########
    $base64IconString = ""
    $iconimageBytes = [Convert]::FromBase64String($base64IconString)
    $ims = New-Object IO.MemoryStream($iconimageBytes, 0, $iconimageBytes.Length)
    $Form6.Icon = [System.Drawing.Icon]::FromHandle((new-object System.Drawing.Bitmap -argument $ims).GetHIcon())

    #
    #BotaoClose
    #
    $BotaoClose = New-Object System.Windows.Forms.Button
    $BotaoClose.Font = New-Object System.Drawing.Font("Microsoft Sans Serif", 10, [System.Drawing.FontStyle]::Bold)
    $BotaoClose.Text = "SAIR"
    $BotaoClose.Size = New-Object System.Drawing.Size(80, 35)
    $BotaoClose_X = ($Form6.ClientSize.Width / 2) - ($BotaoClose.Width / 2)
    $BotaoClose_Y = $Form6.ClientSize.Height - 50
    $BotaoClose.Location = New-Object System.Drawing.Point($BotaoClose_X, $BotaoClose_Y)
    $Form6.Controls.Add($BotaoClose)

    ### BotaoClose Event Handler
    #
    ## Método 1 - através da variável $BotaoClose_Click
    #$BotaoClose.Add_Click($BotaoClose_Click)


    ### BotaoClose Event Handler
    #
    ## Método 2 - código integrado
 <#
    $BotaoClose.Add_Click({
            $Form6.Close()
            #
            #
            #...
        })
 #>

    ### BotaoClose Event Handler
    #
    ## Método 3 - através de uma chamada de função
    #<#
    $BotaoClose.Add_Click({
        BotaoClose_Click
    })
    #>
    # Exibe o Form
    [System.Windows.Forms.Application]::Run($Form6)
 
} ### End _Main


    ### BotaoClose Event Handler
    #
    ## Método 1 - através da variável $BotaoClose_Click
    $BotaoClose_Click = {
        $Form6.Close()
    }

    ### BotaoClose Event Handler
    #
    ## Método 3 - através de uma função
    Function BotaoClose_Click() {
        $Form6.Close()
        #
        #
        #....
    }

_Main


